import React from 'react';
import { slide as Menu } from 'react-burger-menu';

export default props => {
  return (
    <Menu>
      <a className="menu-item" href="/admin">
        Dash Board
      </a>

      <a className="menu-item" href="">
        Student
      </a>

      <a className="menu-item" href="">
        Teacher
      </a>

      <a className="menu-item" href="">
        Schedule
      </a>

      <a className="menu-item" href="">
        Transportation
      </a>

      <a className="menu-item" href="">
        Setting
      </a>
    </Menu>
  );
};
